import React from 'react';
import './about.css';

import ProfilePic from '../../images/profile_pic.jpg';

function About() {
    return (
        <div>
            <div className="about">
                <div className="about-title">
                    About
                </div>
                <div className="about-img-container">
                    <img className="about-img" src={ProfilePic}/>
                </div>
            </div>
        </div>
    )
}

export default About;
